In the previous section we produced a canonical query result. We now have to apply that result in our original context. If you recall, way back in the beginning, we were trying to prove this query: ?A: Foo<'static, ?B> We canonicalized that into this: for<T,L,T> { ?0: Foo<'?1, ?2> } and now we got back a canonical response: for<T, L> { certainty: Proven, var_values: [Vec<?0>, '?1, ?0] region_constraints: [?0: '?1], value: (),
} We now want to apply that response to our context. Conceptually, how we do that is to (a) instantiate each of the canonical variables in the result with a fresh inference variable, (b) unify the values in the result with the original values, and then (c) record the region constraints for later. Doing step (a) would yield a result of { certainty: Proven, var_values: [Vec<?C>, '?D, ?C] ^^ ^^^ fresh inference variables region_constraints: [?C: '?D], value: (),
} Step (b) would then unify: ?A with Vec<?C>
'static with '?D
?B with ?C And finally the region constraint of ?C: 'static would be recorded for later verification. (What we actually do is a mildly optimized variant of that: Rather than eagerly instantiating all of the canonical values in the result with variables, we instead walk the vector of values, looking for cases where the value is just a canonical variable. In our example, values[2] is ?C, so that means we can deduce that ?C := ?B and '?D := 'static. This gives us a partial set of values. Anything for which we do not find a value, we create an inference variable.)

