For every Goal, there are zero or more Answers. Each Answer contains values for the inference variables in the goal. For example, given the following program: trait Clone {}
struct A {}
struct B {}
impl Clone for A {}
impl Clone for B {} With the following goal: exists<T> { T: Clone } The following solutions would be given: T = A
T = B In other words, either A or B can substituted for T and the goal will hold true. Moreover, either answer could be used when further solving other goals that depend on this goal. However, oftentimes, this is not what external crates want when solving for a goal. Instead, the may want a unique solution to this goal. Indeed, when we solve for a given root Goal , we return a since Solution . It is up to the implementation of Context to decide how a Solution is made, given a possibly infinite set of answers. One of example of this is the AntiUnifier from chalk-solve, which finds a minimal generalization of answers which don't unify. (For the example above, it would return only Ambiguous, since A and B can't unify.)

