The recursive solver is so-called because, in the process of solving one goal, it will "recurse" to solve another. Consider an example like this: trait A { }
impl<T: A> A for Vec<T> { }
impl A for u32 { }
impl A for i32 { } which results in program clauses like: forall<T> { Implemented(Vec<T>: A) :- Implemented(T: A) }
Implemented(u32: A)
Implemented(i32: A) First, suppose that we have a goal like Implemented(Vec<u64>: A). This would proceed like so: Solve(Implemented(Vec<u64>: A)) Solve(Implemented(u64: A)) returns Error returns Error In other words, the recursive solver would start by applying the first rule, which would cause us recursively try to solve Implemented(u64: A). This would yield an Error result, because there are no applicable rules, and that error would propagate back up, causing the entire attempt at proving things to fail. Next, consider Implemented(Vec<u32>: A). This would proceed like so: Solve(Implemented(Vec<u32>: A)) Solve(Implemented(u32: A)) returns Provable with no substitution (no variables) returns Provable Finally, consider Implemented(Vec<?X>: A). This is more interesting because it has a variable: Solve(Implemented(Vec<?X>: A)) Solve(Implemented(?X: A)) finds two viable solutions, returns Ambiguous returns Ambiguous

