By default, Rust trait solving is inductive . What that means is that, roughly speaking, you have to prove something is true without any cycles (i.e., you can't say "it's true because it's true"!). For our purpose, a "cycle" means that, in the course of proving some canonical goal G, we had to prove that same goal G again. Consider this Rust program: trait A { }
impl<T: A> A for Vec<T> { }
impl A for u32 { } Whether or not we hit a cycle will depend on the goal we are trying to solve. If for example we are trying to prove Implemented(Vec<u32>: A), then we don't hit any cycle: Implemented(Vec<u32>: A) :- Implemented(u32: A) // from the first impl Implemented(u32: A) // from the second impl But what if we are trying to prove Implemented(?X: A)? This is a bit more interesting. Because we don't know what ?X is, both impls are actually potentially applicable, so we wind up with two ways to prove our goal. We will try them out one after the other. One possible execution might be: Prove Implemented(?X: A) we find the program clause forall<T> { Implemented(Vec<T>: A) :- Implemented(T: A) } from the first impl we create the variable ?Y to represent T and unify ?X = Vec<?Y>. after unification, we have the subgoal Implemented(?Y: A) when we go to recursively prove this impl, however, we find that it is already on the stack this is because the canonical form of Implemented(?X: A) and Implemented(?Y: A) is the same

