You might be wondering whether there are any examples of inductive cycles that actually terminate successfully and without ambiguity. In fact, there are very few, but you can construct an example like this: trait C { }
impl<T: C + D> C for Vec<T> { }
impl C for u32 { } trait D { } In this case, the only valid result of Implemented(?X: C) is ?X = u32. It can't be Vec<u32> because Implemented(u32: D) is not true. How does this work out with the recursive solver? In the first iteration, we wind up with ?X = u32, but we do encounter a cycle: proving Implemented(?X: C) has two possibilities... ?X = Vec<?Y> and Implemented(?Y: C), which is a cycle (error, at least in this iteration) ?X = u32, succeeds So then we try the next iteration: proving Implemented(?X: C) has two possibilities... ?X = Vec<?Y> and Implemented(?Y: C), which is a cycle, so we use our previous result of ?Y = u32 we then have to prove Implemented(u32: D), which fails ?X = u32, succeeds

