A clause is the disjunction of several expressions. For example the clause condition_1 || condition_2 || ... states that at least one of the conditions holds. There are two notable special cases of clauses. A Horn clause has at most one positive literal. A Definite clause has exactly one positive literal. Horn clauses can be written in the form A || !B || !C || ... with A being the optional positive literal. Due to the equivalence (P => Q) <=> (!P || Q) the clause can be expressed as B && C && ... => A which means that A is true if B, C, etc. are all true. All rules in chalk are in this form. For example struct A<T> {}
impl<T> B for A<T> where T: C + D {} is expressed as the Horn clause (T: C) && (T: D) => (A<T>: B). This formula has to hold for all values of T. The second example struct A {}
impl B for A {}
impl C for A {} is expressed as the Horn clause (A: B) && (A: C). Note the missing consequence.

