} This means we can normalize the projection <Option<u32> as IntoIterator>::Item to just u32. In this case, the projection was a "monomorphic" one – that is, it did not have any type parameters. Monomorphic projections are special because they can always be fully normalized. Often, we can normalize other associated type projections as well. For example, <Option<?T> as IntoIterator>::Item, where ?T is an inference variable, can be normalized to just ?T. In our logic, normalization is defined by a predicate Normalize. The Normalize clauses arise only from impls. For example, the impl of IntoIterator for Option<T> that we saw above would be lowered to a program clause like so: forall<T> { Normalize(<Option<T> as IntoIterator>::Item -> T) :- Implemented(Option<T>: IntoIterator)
} where in this case, the one Implemented condition is always true. Since we do not permit quantification over traits, this is really more like a family of program clauses, one for each associated type. We could apply that rule to normalize either of the examples that we've seen so far.

