Implied bounds remove the need to repeat where clauses written on a type declaration or a trait declaration. For example, say we have the following type declaration: struct HashSet<K: Hash> { ...
} then everywhere we use HashSet<K> as an "input" type, that is appearing in the receiver type of an impl or in the arguments of a function, we don't want to have to repeat the where K: Hash bound, as in: // I don't want to have to repeat `where K: Hash` here.
impl<K> HashSet<K> { ...
} // Same here.
fn loud_insert<K>(set: &mut HashSet<K>, item: K) { println!("inserting!"); set.insert(item);
} Note that in the loud_insert example, HashSet<K> is not the type of the set argument of loud_insert, it only appears in the argument type &mut HashSet<K>: we care about every type appearing in the function's header (the header is the signature without the return type), not only types of the function's arguments. The rationale for applying implied bounds to input types is that, for example, in order to call the loud_insert function above, the programmer must have produced the type HashSet<K> already, hence the compiler already verified that HashSet<K> was well-formed, i.e. that K effectively implemented Hash, as in the following example: fn main() { // I am producing a value of type `HashSet<i32>`. // If `i32` was not `Hash`, the compiler would report an error here. let set: HashSet<i32> = HashSet::new(); loud_insert(&mut set, 5);
} Hence, we don't want to repeat where clauses for input types because that would sort of duplicate the work of the programmer, having to verify that their types are well-formed both when calling the function and when using them in the arguments of their function. The same reasoning applies when using an impl. Similarly, given the following trait declaration: trait Copy where Self: Clone { // desugared version of `Copy: Clone` ...
} then everywhere we bound over SomeType: Copy, we would like to be able to use the fact that SomeType: Clone without having to write it explicitly, as in: fn loud_clone<T: Clone>(x: T) { println!("cloning!"); x.clone();
} fn fun_with_copy<T: Copy>(x: T) { println!("will clone a `Copy` type soon..."); // I'm using `loud_clone<T: Clone>` with `T: Copy`, I know this // implies `T: Clone` so I don't want to have to write it explicitly. loud_clone(x);
} The rationale for implied bounds for traits is that if a type implements Copy, that is, if there exists an impl Copy for that type, there ought to exist an impl Clone for that type, otherwise the compiler would have reported an error in the first place. So again, if we were forced to repeat the additional where SomeType: Clone everywhere whereas we already know that SomeType: Copy hold, we would kind of duplicate the verification work. Implied bounds are not yet completely enforced in rustc, at the moment it only works for outlive requirements, super trait bounds, and bounds on associated types. The full RFC can be found here . We'll give here a brief view of how implied bounds work and why we chose to implement it that way. The complete set of lowering rules can be found in the corresponding chapter .

