Now we need to express implied bounds in terms of logical rules. We will start with exposing a naive way to do it. Suppose that we have the following traits: trait Foo { ...
} trait Bar where Self: Foo { } { ...
} So we would like to say that if a type implements Bar, then necessarily it must also implement Foo. We might think that a clause like this would work: forall<Type> { Implemented(Type: Foo) :- Implemented(Type: Bar).
} Now suppose that we just write this impl: struct X; impl Bar for X { } Clearly this should not be allowed: indeed, we wrote a Bar impl for X, but the Bar trait requires that we also implement Foo for X, which we never did. In terms of what the compiler does, this would look like this: struct X; impl Bar for X { // We are in a `Bar` impl for the type `X`. // There is a `where Self: Foo` bound on the `Bar` trait declaration. // Hence I need to prove that `X` also implements `Foo` for that impl // to be legal.
} So the compiler would try to prove Implemented(X: Foo). Of course it will not find any impl Foo for X since we did not write any. However, it will see our implied bound clause: forall<Type> { Implemented(Type: Foo) :- Implemented(Type: Bar).
} so that it may be able to prove Implemented(X: Foo) if Implemented(X: Bar) holds. And it turns out that Implemented(X: Bar) does hold since we wrote a Bar impl for X! Hence the compiler will accept the Bar impl while it should not.

