From the trait itself we mostly make "meta" rules that setup the relationships between different kinds of domain goals. The first such rule from the trait header creates the mapping between the FromEnv and Implemented predicates: // Rule Implemented-From-Env
forall<Self, P1..Pn> { Implemented(Self: Trait<P1..Pn>) :- FromEnv(Self: Trait<P1..Pn>)
} Implied bounds The next few clauses have to do with implied bounds (see also RFC 2089 and the implied bounds chapter for a more in depth cover). For each trait, we produce two clauses: // Rule Implied-Bound-From-Trait
//
// For each where clause WC:
forall<Self, P1..Pn> { FromEnv(WC) :- FromEnv(Self: Trait<P1..Pn>)
} This clause says that if we are assuming that the trait holds, then we can also assume that its where-clauses hold. It's perhaps useful to see an example: trait Eq: PartialEq { ... } In this case, the PartialEq supertrait is equivalent to a where Self: PartialEq where clause, in our simplified model. The program clause above therefore states that if we can prove FromEnv(T: Eq) – e.g., if we are in some function with T: Eq in its where clauses – then we also know that FromEnv(T: PartialEq). Thus the set of things that follow from the environment are not only the direct where clauses but also things that follow from them. The next rule is related; it defines what it means for a trait reference to be well-formed : // Rule WellFormed-TraitRef
forall<Self, P1..Pn> { WellFormed(Self: Trait<P1..Pn>) :- Implemented(Self: Trait<P1..Pn>) && WellFormed(WC)
} This WellFormed rule states that T: Trait is well-formed if (a) T: Trait is implemented and (b) all the where-clauses declared on Trait are well-formed (and hence they are implemented). Remember that the WellFormed predicate is coinductive ; in this case, it is serving as a kind of "carrier" that allows us to enumerate all the where clauses that are transitively implied by T: Trait. An example: trait Foo: A + Bar { }
trait Bar: B + Foo { }
trait A { }
trait B { } Here, the transitive set of implications for T: Foo are T: A, T: Bar, and T: B. And indeed if we were to try to prove WellFormed(T: Foo), we would have to prove each one of those: WellFormed(T: Foo) Implemented(T: Foo) WellFormed(T: A) Implemented(T: A) WellFormed(T: Bar) Implemented(T: Bar) WellFormed(T: B) Implemented(T: Bar) WellFormed(T: Foo) -- cycle, true coinductively This WellFormed predicate is only used when proving that impls are well-formed – basically, for each impl of some trait ref TraitRef, we must show that WellFormed(TraitRef). This in turn justifies the implied bounds rules that allow us to extend the set of FromEnv items.

