// see "associated type" chapter for more:
forall<Self, P1..Pn, Pn+1..Pm> { ProjectionEq( <Self as Trait<P1..Pn>>::AssocType<Pn+1..Pm> = (Trait::AssocType)<Self, P1..Pn, Pn+1..Pm> )
} The next rule covers implied bounds for the projection. In particular, the Bounds declared on the associated type must have been proven to hold to show that the impl is well-formed, and hence we can rely on them elsewhere. // Rule Implied-Bound-From-AssocTy
//
// For each `Bound` in `Bounds`:
forall<Self, P1..Pn, Pn+1..Pm> { FromEnv(<Self as Trait<P1..Pn>>::AssocType<Pn+1..Pm>>: Bound) :- FromEnv(Self: Trait<P1..Pn>) && WC1
} Next, we define the requirements for an instantiation of our associated type to be well-formed... // Rule WellFormed-AssocTy
forall<Self, P1..Pn, Pn+1..Pm> { WellFormed((Trait::AssocType)<Self, P1..Pn, Pn+1..Pm>) :- Implemented(Self: Trait<P1..Pn>) && WC1
} ...along with the reverse implications, when we can assume that it is well-formed. // Rule Implied-WC-From-AssocTy
//
// For each where clause WC1:
forall<Self, P1..Pn, Pn+1..Pm> { FromEnv(WC1) :- FromEnv((Trait::AssocType)<Self, P1..Pn, Pn+1..Pm>)
} // Rule Implied-Trait-From-AssocTy
forall<Self, P1..Pn, Pn+1..Pm> { FromEnv(Self: Trait<P1..Pn>) :- FromEnv((Trait::AssocType)<Self, P1..Pn, Pn+1..Pm>)
}

