Given a general type definition: struct Type<P...> where WC_type { field1: A1, ... fieldn: An,
} we generate the following goal, which represents its well-formedness condition: forall<P...> { if (FromEnv(WC_type)) { WellFormed(InputTypes(WC_type)) && WellFormed(InputTypes(A1)) && ... WellFormed(InputTypes(An)) }
} which in English states: assuming that the where clauses defined on the type hold, prove that every type appearing in the type definition is well-formed. Some examples: struct OnlyClone<T> where T: Clone { clonable: T,
}
// The only types appearing are type parameters: we have nothing to check,
// the type definition is well-formed. struct Foo<T> where T: Clone { foo: OnlyClone<T>,
}
// The only non-parameter type which appears in this definition is
// `OnlyClone<T>`. The generated goal is the following:
// ```
// forall<T> {
// if (FromEnv(T: Clone)) {
// WellFormed(OnlyClone<T>)
// }
// }
// ```
// which is provable. struct Bar<T> where <T as Iterator>::Item: Debug { bar: i32,
}
// The only non-parameter types which appear in this definition are
// `<T as Iterator>::Item` and `i32`. The generated goal is the following:
// ```
// forall<T> {
// if (FromEnv(<T as Iterator>::Item: Debug)) {
// WellFormed(<T as Iterator>::Item) &&
// WellFormed(i32)
// }
// }
// ```
// which is not provable since `WellFormed(<T as Iterator>::Item)` requires
// proving `Implemented(T: Iterator)`, and we are unable to prove that for an
// unknown `T`.
//
// Hence, this type definition is considered illegal. An additional
// `where T: Iterator` would make it legal.

