Given a general trait definition: trait Trait<P1...> where WC_trait { type Assoc<P2...>: Bounds_assoc where WC_assoc;
} we generate the following goal: forall<P1...> { if (FromEnv(WC_trait)) { WellFormed(InputTypes(WC_trait)) && forall<P2...> { if (FromEnv(WC_assoc)) { WellFormed(InputTypes(Bounds_assoc)) && WellFormed(InputTypes(WC_assoc)) } } }
} There is not much to verify in a trait definition. We just want to prove that the types appearing in the trait definition are well-formed, under the assumption that the different where clauses hold. Some examples: trait Foo<T> where T: Iterator, <T as Iterator>::Item: Debug { ...
}
// The only non-parameter type which appears in this definition is
// `<T as Iterator>::Item`. The generated goal is the following:
// ```
// forall<T> {
// if (FromEnv(T: Iterator), FromEnv(<T as Iterator>::Item: Debug)) {
// WellFormed(<T as Iterator>::Item)
// }
// }
// ```
// which is provable thanks to the `FromEnv(T: Iterator)` assumption. trait Bar { type Assoc<T>: From<<T as Iterator>::Item>;
}
// The only non-parameter type which appears in this definition is
// `<T as Iterator>::Item`. The generated goal is the following:
// ```
// forall<T> {
// WellFormed(<T as Iterator>::Item)
// }
// ```
// which is not provable, hence the trait definition is considered illegal. trait Baz { type Assoc<T>: From<<T as Iterator>::Item> where T: Iterator;
}
// The generated goal is now:
// ```
// forall<T> {
// if (FromEnv(T: Iterator)) {
// WellFormed(<T as Iterator>::Item)
// }
// }
// ```
// which is now provable.

